map_data.Mountain.note = "-- Mountain Map Special Rule --\n\n Closed Paths:\n A path covered with a closed path marker is a closed path. Clearings linked by a closed path are not adjacent. (Closed paths enclose and divide forests exactly as paths do. \n\n Removing Closed Paths: \n Once per turn during Daylight, a player can spend a card to remove a closed path marker, return it to the box, and score one victory point. The player must have any number of pieces in any clearing linked to the closed path marker in order to remove it. \n\n The Pass:\n The clearing marked with a “P” is The Pass. At the end of a player’s Evening, if that player rules the Pass, that player scores 1 victory point.)"
